【24h コスメ プレミアム ミネラルファンデーションセット 00 ペールオークルの詳細】<br>●紫外線吸収剤不使用。<br>●天然ミネラルと保湿成分に加え、天然エイジングケア成分を配合したファンデーションセットです。<br>●SPF40 PA+++<br><br>【ご注意】<br>○お肌に異常が生じていないかよく注意して使用してください。化粧品がお肌に合わないとき、即ち次のような場合には、使用を中止してください。そのまま化粧品類の使用を続けますと、症状が悪化することがありますので、皮膚科専門医等にご相談されることをおすすめします。<br>1.使用中、赤味、はれ、かゆみ、刺激や黒ずみ等の異常が現れた場合。<br>2.使用したお肌に、直射日光があたって上記のような異常が現れた場合。<br>○化学合成防腐剤を使用しておりませんので、パフは清潔に保ってください。また、ファンデーションの上にパフを乗せた状態での保管は避けてください。<br>○使用後は必ずフタをしっかり閉めてください。<br>○専用のパウダーファンデーションケースにセットしてご使用ください。<br>○デリケートな素材のため、強い衝撃は避けてください。<br>○極端に高温・低温になる場所での保管はおやめください。<br><br>【成分】<br>マイカ、ホホバ種子油、アロエベラ葉エキス、ヤシ油、ヒマシ油、ツバキ油、サンゴ末、アルガニアスピノサ核油、アボカド油、シャクヤクエキス、ビワ葉エキス、ショウブ根エキス、ボタンエキス、水、エタノール、トコフェロール、(+／-)酸化チタン、酸化鉄、タルク、シリカ<br><br>【内容量】<br>11g<br><br>【原産国】<br>日本<br><br>【販売元・製造元・輸入者名】<br>ナチュラピュリファイ研究所<br>東京都中央区日本橋3-5-133 義ビル7階<br>03-6262-1041<br><br>【商品区分】<br>化粧品<br><br>［ベースメイク　ファンデーション］<br><br><br><hr>広告文責：株式会社モリキ<br>電話：0269-38-0611<br><style type="text/css">
