【キス プライムモイスト ライトファンデーションUV 01 ライトの詳細】<br>
●軽いつけ心地で「厚塗り感ゼロ」なのに、毛穴・くま・シミ・くすみ・そばかすを自然にカバー。スキンコントロールパウダー配合で透明感のある立体的な美肌に。<br>
●肌にぴたっとフィットし、うるおいをキープ。乾燥ムラや粉ふきを防いで美しい仕上がりが長時間続きます。<br>
●SPF21 PA++。<br>
●スーパーヒアルロン酸・シルクパウダー・ローズヒップ・スクワラン・アルガン（うるおい成分）配合。<br>
●ニキビのもとになりにくい処方。<br><br>

【使用方法】<br>
パフに適量をとり、顔の内側から外側に向かってなじませてください。<br><br>

【ご注意】<br>
○傷、はれもの、湿疹等、異常のある時は、ご使用をおやめ下さい。<br>
○お肌に異常が生じていないかよく注意してご使用下さい。<br>
○使用中、又は使用後日光にあたって、赤み、はれ、かゆみ、刺激等の異常があらわれた時は、使用を中止し、皮膚科専門医又は弊社へご相談をおすすめします。そのまま他の化粧品も含めて使用を続けますと悪化することがあります。<br>
○使用量が少ないと、紫外線防止効果が得られにくくなります。<br>
○商品のSPF表示は、国際的に定められている標準塗布量に従い1cm2あたり2mgを皮ふに塗布して測定した結果です。<br>
○目に入った時はこすらず、すぐに水かぬるま湯で洗い流してください。異物感が残る場合は眼科医へご相談をおすすめします。<br>
○落下などで衝撃を与えると破損の原因となりますのでご注意下さい。<br>
○中の透明フィルムは捨てずにパウダーの上においてご使用下さい。<br>
○パフはいつも清潔にお使い下さい。汚れた時は中性洗剤で軽く押し洗いして、よくすすいだ後、陰干しして下さい。<br>
○極端に高温又は低温の場所、直射日光の当たる場所には置かないで下さい。<br>
○乳幼児の手の届かない場所に保管して下さい。<br><br>

【成分】<br>
タルク 合成フルオロフロゴパイト ラウロイルリシン シリカ アクリレーツクロスポリマー ポリメチルシルセスキオキサン メトキシケイヒ酸エチルヘキシル フェニルトリメチコン リンゴ酸ジイソステアリル 酸化亜鉛 ジフェニルシロキシフェニルトリメチコン アルミナアルガニアスピノサ核油 カニナバラ果実油 スクワラン シルク アセチルヒアルロン酸Na BGジメチコノール ジメチコン セバシン酸イソステアリル ハイドロゲンジメチコン （ビニルジメチコン／メチコンシルセスキオキサン）クロスポリマー ステアリン酸 メチルパラベン 水 ステアロイルグルタミン酸２Na 水酸化AI BHT 酸化チタン 酸化鉄 マイカ 酸化スズ<br><br>

