【ロレアル パリ ルーセントマジック クッションポーセリン N2 アイボリーミラクルの詳細】<br>
●カバー力も素肌感も。タップでわがままと向き合う次世代クッションファンデ。<br>
●クッションなのに高カバー、クッションなのに仕上がり続く。<br>
●二層のネットを取り入れた新形状で洗練された仕上がりを演出。<br>
●オイルタッチ成分配合の濃厚リキッドがふんわりとした軽くきめ細かい質感で、肌に密着。<br><br>

【使用方法】<br>
1.専用パフをネットに3回ほど押し付け、（初めてお使いいただくときは5回ほど）ネットを上下させてファンデーションを取ります。<br>
2.パフを軽くトントンと肌に叩き込むように塗布します。<br>
3.さらにカバー力はほしい場合は、パフをネットにもう一度押し付け、気になる箇所へタップします。<br>
4.使用後はパフをティッシュに押し当て、パフに残った余分なファンデーションを取って保管してください。<br><br>

【ご注意】<br>
○傷、湿疹等肌に異常のある時は使用しないでください。<br>
○お肌に異常が生じていないかよく注意して使用してください。<br>
○使用中、赤味、かゆみ、刺激等の異常が出たら、使用を中止し、皮膚専門医等へ相談してください。そのまま使用を続けると症状が悪化することがあります。<br>
○使用量が少ないと、紫外線防止効果が得られにくくなるため、効果的に製品をご使用頂くためには十分な量を肌にムラなくのばし、こまめに塗り直してください。<br><br>

【成分】<br>
水、シクロペンタシロキサン、メトキシケイヒ酸エチルヘキシル、酸化チタン、ジフェニルシロキシフェニルトリメチコン、シクロヘキサシロキサン、グリセリン、サリチル酸エチルヘキシル、ジ(カプリル／カプリン酸)BG、セチルPEG／PPG-10／1ジメチコン、ペンチレングリコール、ジステアルジモニウムヘクトライト、ナイロン-12、メタクリル酸メチルクロスポリマー、PEG-10ジメチコン、イソステアリン酸ソルビタン、トリベヘニン、水酸化AL硫酸Mg、フェノキシエタノール、カプリリルメチコン、(ビニルジメチコン／メチコンシルセスキオキサン)クロスポリマー、ステアリン酸、ジメチコン、セレシン、ヘキサデセン、クロルフェネシン、トリエトキシカプリリルシラン、エチルヘキシルグリセリン、EDTA-2Na、BHT、[+／-]、酸化チタン、酸化鉄、アルミナ<br><br>

