●皮脂吸着パウダー配合!!さらさらマット肌を長時間キープ！<br>
●微細パウダーで粉浮きゼロ！ふわっと軽い付け心地で、メイク直しにも。<br>
●やわらかマシュマロスポンジとミラー付き！中身はもちろん、使いやすさにもこだわりが!!<br><br>

【使用方法】<br>
付属のパフに適量をとり、顔の中心から外側に向かって伸ばしてご使用下さい。よりナチュラルに仕上げたい場合はブラシにとってご使用下さい。<br><br>

【ご注意】<br>
ご使用中、赤み・はれ・かゆみ・しげきなどの異常があらわれた場合は ご使用を中止し、皮膚科専門医にご相談ください。<br><br>

【成分】<br>
タルク、マイカ、酸化チタン、メタクリル酸メチルクロスポリマー、イソノナン酸イソトリデシル、ハイドロゲンジメチコン、シリカ、トリエチルヘキサノイン、ジメチコン、ヘキサ（ヒドロキシステアリン酸／ステアリン酸／ロジン酸）ジペンタエリスリチル、ステアリン酸、酸化亜鉛、水酸化Ａｌ、フェノキシエタノール、酸化鉄<br><br>

【内容量】<br>
10g<br><br>

【販売元】<br>
株式会社T-Garden<br>
東京都渋谷区渋谷3-27-11-5F<br>
お電話：0120-0202-16<br><br>

【商品区分】<br>
化粧品<br><br>

[益若つばさプロデュースコスメ パウダーファンデーション] 

